style.css:
@-moz-document url-prefix("https://webapp.rethinkbehavioralhealth.com") {
session-notes {
  height: 450px !important;
}

.headerUserInfo {
  padding-top: 10px !Important;
}


#clientPickerWrapper {
}

#clientPickerWrapper DIV[style="overflow: visible; padding-top: 15px; "] {
  padding-top:0px !important;
}

.clientStaffDisplay {
  margin-top:-48px !important;
}

/* Client Picker */

.ChildPicker {
/*  margin-top:20px !important; */
  background: none !Important;
  position: fixed !important;
  top: -15px !important;
  left: 20% !important;
  right: 0 !important;
  margin-left: auto !important;
  margin-right: auto !important;
  width:200px !important;
  z-index: 9999 !important;
}

/*

*/

#ChildPickerSelect {
  margin-top: 17px !important;
  border-radius: 0.25rem !important;
  border-color: #e4e7eb !important;
  color: #212529 !important;
  text-transform: none !important;
  padding-left: 10px !important;
  font-weight: 400 !important;
}

div.ChildPicker.pb-4.d-flex.ng-star-inserted > div.bod, div.ChildPicker.pb-4.d-flex.ng-star-inserted > div.ng-star-inserted {
  display:none !important;
}

.headerUserInfo {
  position: relative !important;
  right: 14% !important;
}

/* Header and Footer Colors */

.headerBorder, .publicFooter .Bottom, .publicFooter .Top {
  background: #2a485c !important;
}

.headerSpacer[style="clear: both; padding-bottom: 25px;"] {
  padding-bottom:15px !important;
}

.clientPicker option {
  font-size:13px !important;
  text-transform: none !important;
  color: #212529 !important;
}

#clientPickerWrapper .ChildPicker select, #clientPickerWrapper .ChildPicker{
  font-size:13px !important;
  width: 200px !important;
}

div[style="margin-top:10px; overflow: hidden;"] > div[style="font-size: 16px; font-weight: normal;"] {
margin-top: 8px !important;
}

client-info.ng-star-inserted {
  margin-bottom: 10px !important;
  font-family: Calibri !important;
}

div.p-2.content-container {
  border: 2px solid #ebedf0 !important;
  border-radius: 0 4px 4px 4px !important;
}

#clientPickerWrapper .ChildPicker select {
  background-position: 100% 100% !important;
}

#targetsTable th {
  background-color: #d9dee8 !important;
}

#targetsTable th:first-child {
  border-radius: 4px 0 0 0 !important;
}

#targetsTable th:last-child {
  border-radius: 0 4px 0 0 !important;
}

#targetsTable {
  border: 2px solid #e6e9eb !important;
  border-radius: 4px !important;
}

#targetsTable tr[style="border-bottom:1px solid #ccc;"] {
  border-color: #ebebeb !important;
}

#targetsTable tbody:last-child {
  border-radius: 0 0 4px 4px !important;
}

#targetsTable td {
  padding: 6px !important;
}

#targetsTable button {
  appearance: auto !important;
}

.ActiveTreatmentGoalDefault, .customLessonBackground, .lessonBackground {
  border-radius: 4px !important;
}

.ActiveTreatmentGoalDefault {
  padding-left: 10px !important;
  min-height: 50px !important;
}

#content .WorkAreaNavigationLabel:hover, #interventionModeBTN, #probeBTN:hover, .behaviorBackground, .customLessonBackground {
  background-color: #8b9bbe !important;
}

.programList, .dataEnry_contentWrapper {
  background-color: #f4f5f6 !important;
}

.dataEnry_contentWrapper {
  border-color: #dcdcdc !important;
}

#contentContainerDataEntry {
  border-bottom: 3px solid #f4f5f6 !important;
  border-top: 3px solid #f4f5f6 !important;
  border-right: 3px solid #f4f5f6 !important;
}

#contentContainer {
  border: 3px solid #f4f5f6 !important;
}

DIV[style="margin-top:10px; overflow: hidden;"] {
  margin-top: 0px !important;
}

.nav-tabs>li.active>a, .nav-tabs>li.active>a:focus, .nav-tabs>li.active>a:hover {
  background-color: #f4f5f6 !important;
  border-color:#f4f5f6 !important;
}

#goalsList {
  width:238px !important;
}

.ChildPickerAge {
  display:none !important;
}

.SubNav {
  position: relative !important;
  top: 0px !important;
  left: 0 !important;
  right: 0 !important;
  margin-left: auto !important;
  margin-right: auto !important;
  width: 1220px !important;
}

.clientStaffDisplay {
  position: absolute !important;
  right: 0 !important;
  left: 0 !important;
  margin-left: auto !important;
  margin-right: auto !important;
  width: 1220px !important;
}

.SubNav .Item {
  background: #2a485c  !important;
  border-radius: 4px !Important;
  color: #FAFAFA !important;
  font-size: 10px !important;
  font-weight: 600 !important;
}

.NavBar {
  background: #f4f5f6 !important;
  color: #666 !important;
  padding-bottom:10px !important;
  font-size:13px !important;
  font-weight:400 !important;
  font-family: Calibri !important;
  margin-top:0 !important;
}

.NavTransition {
  display:none !Important;
}

.publicFooter .Top {
  padding-bottom: 0px !important;
  height: 140px !important;
}

.publicFooter {
  height: 140px !important;
}

#old-side-bar, .publicHeader .clearfix {
  background-color: #f4f5f6 !important;
}

.LogoDiv IMG {
  width:150px !important;
}

/* Dark Color */

.ra-btn, .dataEnry_contentWrapper button.Top, .SaveBTN,  .copyPrintBtns .btn {
  border-radius: 4px !Important;
  color: #FAFAFA !important;
  font-size: 9px !important;
  font-weight: 600 !important;
  letter-spacing: 1px !important;
  background-color: #7cb7e4 !important;
  border-color: #b0c1d0 !important;
  padding-bottom: 5px !important;
}

/* Light Color */

.ProgramArea #contentContainer .btn, .btn-primary, #targetsTable button {
  border-radius: 4px !Important;
  color: #717171 !important;
  font-size: 9px !important;
  font-weight: 600 !important;
  letter-spacing: 1px !important;
  background: none !important;
  border: 1px solid !important;
  border-color: #e2ecf5 !important;
  padding-bottom: 5px !important;
}

#targetsTable button{
  border-color: #acb1b6 !important;}

#targetsTable button [disabled] {
  border-color: #e2ecf5 !important;
}

.ProgramArea #contentContainer .btn:hover, .ProgramArea #contentContainer  .btn-primary:hover {
  color: #000 !important;
}

.activateOnHover button i.fa, button i.fa, i.fa {
  color: #2a485c !important;
}

/* Client Program Nav Tabs */

body, ul.nav-tabs.nav li a {
  font-size:13px !important;
}

.headerUserInfo a, .headerUserInfo span {
  font-size: 12px !important;
}

.ChildPicker[_ngcontent-jhm-c355] {
  margin-top: 0px !important;
}

.ChildPicker[_ngcontent-jhm-c355] img {
  width: 20px !important;
  height: 20px !important;
  margin-left: 6px !important;
  margin-top: 6px !important;
}

.dataEntry_wrapper {
  box-shadow: 2px 2px 6px -2px #b3b3b3 !important;
}

.isTaskAnalysisLabel input.custom_input, .custom_input {
  width:35px !important;
  height: 32px !important;
  border: 1px solid #ccc !important;
}

.isTaskAnalysisLabel img {
  height:24px !important;
  width: 24px !important;
}

DIV[class="ng-pristine ng-valid"] span[style="font-size: 24px;"] {
  font-size: 20px !important;
  margin-top:4px !important;
}

BUTTON[class="btn btn-primary clientBTN"] {
  margin-bottom: 3px !important;
}

.viewDetailsBtn {
  color: #333 !important;
}

#btnLinks DIV[class="left"] {
  float: right !important;
}

#btnLinks {
  position: relative !important;
  top:-13px !important;
  right: -20px !Important;
}

.introHeadTxHome {
  margin-bottom: -58px !important;
}

.copyPrintBtns {
  position: relative !important;
  right: 169px !Important;
}

body {
  background: none !Important;
  }
}
